Tabulator.extendModule("format","formatters",{analysis:function(cell,formatterParams,onRendered){var cell_value=cell.getValue();console.log("Analyse cell value = ",cell_value);if(Array.isArray(cell_value.anomalies)){var html='<div class="analysis"><ul>';cell_value.anomalies.forEach(anomaly=>{if(true){html+='<li class="message level-'+anomaly.level+'">'+anomaly.message+"</li>"}});html+="</ul></div>";return html}else{return'<div class="analysis">&varnothing;</div>'}}});